import React from 'react'

export default function School({ school }) {
  return (
    <p>
          <b>{school.degree}</b><br></br>
          {school.institution} - <span>{school.date}</span> - {school.grade} <br></br>
          {school.description}<br></br>
    </p>
  )
}
